public class Solution {
    public long ContinuousSubarrays(int[] nums) {
        long result = 0;
        int n = nums.Length;
        int left = 0;

        for (int right = 0; right < n; right++) {
            int max = nums[right];
            int min = nums[right];
            for (int k = right; k >= left; k--) {
                if (nums[k] > max) max = nums[k];
                if (nums[k] < min) min = nums[k];
                if (max - min > 2) {
                    left = k + 1;
                    break;
                }
                result++;
            }
        }

        return result;
    }
}
